import React from 'react'

export default function Pagination({ gotoNextPage, gotoPrevPag }) {
  return (
    <div>
      <button onClick={gotoPrevPag}>Previous</button>
      <button onClick={gotoNextPage}>Next</button>
    </div>
  )
}
